                                "description_en": "",
                                "description_es": "Debido a la operativa habitual de vuelos con llegada de madrugada, se dispone de hotel desde la llegada.\nInicio de tour clásico de Tiblisi, la capital de Georgia. El tour incluye las siguientes atracciones: Meteji, Iglesia que se erige en un acantilado, con vistas al rio Mtkvari. Se envuelve en la Fortaleza defensiva Narikala, que data del siglo IV.  Podemos bajar por las escaleras de la fortaleza y ver desde lo alto la ciudad. Visitaremos los Baños de Azufre del antiguo Tiflis, iglesias georgianas ortodoxas y armenias gregorianas, una sinagoga judía y una mezquita turca al lado, lo que refleja la aceptación y la tolerancia de diferentes religiones. En el lado opuesto de la calle está la Iglesia Sioni, a la orilla del rio Mtkvari. Aquí se descubre la avenida Shardeni, con sus acogedores cafés de moda y galerías de arte. Caminando nos encontramos con la Iglesia Anchisjati, la iglesia más antigua en Tiblisi que mantiene su imagen milagrosa de Jesucristo. Visita del Museo de Historia. Paseamos por la Avenida de Rustaveli, la calle principal de la ciudad con la visita el estudio de arte donde podremos conocerlaartesanía tradicional. Alojamiento en el hotel.",
