                                "description_es": "Nos dirigimos hacia Kajeti, la cuna del vino para visitar las familias locales y degustar el vino en los tarros típicos georgianos. Para Sentir la hospitalidad de los Campesinos. Por la manana llegamos a la ciudad de Signagui, “Ciudad del Amor”. La ciudad –Museo Signagui es una de las ciudades más pequeñas en Georgia. Signagui, famosa por sus vinos y sus alfombras tradicionales, con su muralla y 23 torres circundando la ciudad eso es la fundación muy particular que ha conservado la arquitectura tradicional.  Visitaremos una granja para aprender el proceso de producción de vinos, y degustar alguno de ellos con almuerzo en una casa local, para acercarnos a la gastronomía típica de esta región. En el deposito de vino con nombre “túnel” degustaremos algunos vino famosos Georgianos. Alojamiento en Kvareli hotel.",
