                                "description_es": "Después del desayuno vamos a Kazbegui. Una impresionante vía desde Gudauri a lo largo del rio Tergi nos llevará a Kazbegui – la principal ciudad de la región. Desde Kazbegui hacemos un agradable viaje a pie(opción con 4x4 local con el pago suplementario) de 1,5 horas  a través de hermosos valles y bosques que nos llevan a Guergueti, iglesia de la Trinidad ubicada a 2170m. Sobre el nivel del mar. Si el tiempo lo permite se puede echar un vistazo a uno de los mayores glaciares del Cáucaso – Mt Kazbegui (5047m). Tras esta visita regreso a pie hasta Kazbegui, visitamos un maestro del lugar que nos explica sobre la “Teka”, artefactos artesanales de tela. Aquí degustamos los dulces tradicionales “Muraba”. Viaje de regreso a Gudauri.",
